import React from "react";

import "./SidebarButton.css";

const SidebarButton = ({ children, icon }) => {
	return (
		<div className="sidebar-button-contianer">
			{icon}
			<button icon={icon} className="sidebar-button">
				{children}
			</button>
		</div>
	);
};

export default SidebarButton;
